Android tablets are hugely flexible, expandable via apps ?? we review more than 60 ?? and even extra hardware. So we've made sure this guide includes all the information you need, illustrated with clear screenshots and step-by-step walkthroughs to help you get the most out of your tablet. With tips, in-depth guides and reviews to help you discover the world of Android tablets.

we show you how to set up your tablet from scratch, introduce key features and learn about Google's latest tablet software: Android 4.3, also known as Jelly Bean. Whether you're thinking of buying, have already bought an Android tablet or are simply curious to know more, this is the guide for you.

